 --CREAR VISTA
 SELECT IDPRODUCTO, EAN, P.DESCRIPCION, PRECIOCOM,PRECIOVEN,C.IDCATEGORIA,C.DESCRIPCION AS DCATEGORIA ,
P.CODUME,(SELECT TD.DESCRIPCION FROM TABLADETALLE TD WHERE TD.IDTABLADETALLE=CODUME) AS DUME, 
P.CODESTADO,(SELECT DESCRIPCION FROM TABLADETALLE WHERE IDTABLADETALLE=CODESTADO) AS DESTADO,
P.FLGELI,CASE WHEN P.FLGELI = 0 THEN 'REGISTRADO' ELSE 'ELIMINADO' END as FLEJE,
P.FCHCREA,P.USRCREA,P.FCHMOD,P.USRMOD FROM TPRODUCTO P INNER JOIN TCATEGORIA C ON P.IDCATEGORIA=C.IDCATEGORIA
GO

CREATE VIEW V_PRODUCTOS AS
SELECT IDPRODUCTO, EAN, P.DESCRIPCION, PRECIOCOM,PRECIOVEN,C.IDCATEGORIA,C.DESCRIPCION AS DCATEGORIA ,
P.CODUME,(SELECT TD.DESCRIPCION FROM TABLADETALLE TD WHERE TD.IDTABLADETALLE=CODUME) AS DUME, 
P.CODESTADO,(SELECT DESCRIPCION FROM TABLADETALLE WHERE IDTABLADETALLE=CODESTADO) AS DESTADO,
P.FLGELI,CASE WHEN P.FLGELI = 0 THEN 'REGISTRADO' ELSE 'ELIMINADO' END as FLEJE,
P.FCHCREA,P.USRCREA,P.FCHMOD,P.USRMOD FROM TPRODUCTO P INNER JOIN TCATEGORIA C ON P.IDCATEGORIA=C.IDCATEGORIA
GO

CREATE VIEW V_CATEGORIAS AS
SELECT IDCATEGORIA,DESCRIPCION,DIARETIRO,CASE WHEN FLGELI = 0 THEN 'REGISTRADO' ELSE 'ELIMINADO' END as FLEJE,FLGELI FROM TCATEGORIA
GO

CREATE VIEW V_PROVEEDORES AS
SELECT IDPROVEEDOR,RUC,RAZONSOCIAL,DIRECCION,TELEFONO,RUBRO,FCHCREA,USRCREA,FCHMOD,USRMOD,CASE WHEN FLGELI = 0 THEN 'REGISTRADO' ELSE 'ELIMINADO' END as FLEJE,FLGELI FROM TPROVEEDOR
GO

CREATE VIEW V_PERFILES AS
SELECT IDPERFIL,DESCRIPCION,CASE WHEN FLGELI = 0 THEN 'REGISTRADO' ELSE 'ELIMINADO' END as FLEJE,FLGELI FROM TPERFIL
GO

CREATE VIEW V_USUARIOS AS
SELECT IDUSUARIO,DNI,NOMBRES,APELLIDOS,FCHNAC,IDPERFIL,
(SELECT P.DESCRIPCION FROM TPERFIL P WHERE P.IDPERFIL=U.IDPERFIL) AS PERFIL
,USUARIO,CLAVE,EMAIL,CASE WHEN FLGELI = 0 THEN 'REGISTRADO' ELSE 'ELIMINADO' END as FLEJE,FLGELI,FCHCREA,USRCREA,FCHMOD,USRMOD FROM TUSUARIO U
GO

CREATE VIEW V_SUCURSALES AS
SELECT 
IDSUCURSAL,
IDTIENDA,
(SELECT T.NOMBRE FROM TTIENDA T WHERE IDTIENDA=S.IDTIENDA) AS TIENDA,
DESCRIPCION,
DIRECCION,
FLGELI
,CASE WHEN FLGELI = 0 THEN 'REGISTRADO' ELSE 'ELIMINADO' END as FLEJE
 FROM TSUCURSAL S
 GO

