SELECT U.IDUSUARIO,SU.IDSUCURSAL,SU.DESCRIPCION,S.FLGELI FROM TUSUARIO U  INNER JOIN (TSUCURSAL_USUARIO S INNER JOIN TSUCURSAL SU 
